Before we talk about what Rust calls bindings, and mutability, let's look at a simple rust program first: hello-world.rs fn main(){ println!("Hello World!"); // Press play to see output
} Rust is similar to programming languages such as C or JavaScript with the syntax that it follows. Most programming languages contains variables, and in Rust they are called bindings . let var = "value; By default, bindings are immutable (value cannot be changed) If we try to set our binding var to another value, the code would not compile: fn main(){ let var = "value"; var = "something else"; println!("{}", var); // Press play to see the compile error
} However Rust does also support mutable bindings in the form of the keyword mut. We could try the program above again, but instead make the binding var mutable. fn main(){ let mut var = "value"; var = "something else"; println!("{}", var); // Press play to see output
} Unlike other programming languages, the Rust compiler will prevent uses of uninitialized bindings: let mut var; //Uninitialized (set to no value)
do_something(var); // Results to error due to uninitialized binding as they contain garbage values and lead to bugs in the code, so instead they are considered invalid.
